import React, {useState, useEffect} from 'react';
import classes from '../../../CSS/GridStyle.module.css'

const GridOverlay = () => {
    return(
        <div>
            <ul className={classes.GridOverlay}>
                <li className={classes.style1}></li>
                <li className={classes.style2}></li>
                <li className={classes.style3}></li>
                <li className={classes.style4}></li>
            </ul>
        </div>
    )
}

export default GridOverlay;
